import { useEffect, useState } from "react";
import Head from "next/head";
import { useRouter } from "next/router";
import {
  Box,
  Button,
  Card,
  CardActions,
  CardContent,
  Container,
  Divider,
  Grid,
  MenuItem,
  TextField,
  Typography,
} from "@mui/material";
import { useTranslation } from "react-i18next";
import { AuthGuard } from "../../../components/authentication/auth-guard";
import { DashboardLayout } from "../../../components/dashboard/dashboard-layout";
import { OverviewBanner } from "../../../components/dashboard/overview/overview-banner";
import { OverviewCryptoWallet } from "../../../components/dashboard/overview/overview-crypto-wallet";
import { OverviewInbox } from "../../../components/dashboard/overview/overview-inbox";
import { OverviewLatestTransactions } from "../../../components/dashboard/overview/overview-latest-transactions";
import { OverviewPrivateWallet } from "../../../components/dashboard/overview/overview-private-wallet";
import { OverviewTotalBalance } from "../../../components/dashboard/overview/overview-total-balance";
import { OverviewTotalTransactions } from "../../../components/dashboard/overview/overview-total-transactions";
import { ArrowRight as ArrowRightIcon } from "../../../icons/arrow-right";
import { Briefcase as BriefcaseIcon } from "../../../icons/briefcase";
import { Download as DownloadIcon } from "../../../icons/download";
import { ExternalLink as ExternalLinkIcon } from "../../../icons/external-link";
import { InformationCircleOutlined as InformationCircleOutlinedIcon } from "../../../icons/information-circle-outlined";
import { Reports as ReportsIcon } from "../../../icons/reports";
import { Users as UsersIcon } from "../../../icons/users";
import { gtm } from "../../../lib/gtm";
import { useAuth } from "../../../hooks/use-auth";

const Overview = () => {
  const [displayBanner, setDisplayBanner] = useState(true);
  const { user } = useAuth();
  const { t } = useTranslation();
  //   const router = useRouter();

  useEffect(() => {
    gtm.push({ event: "page_view" });
  }, []);

  useEffect(() => {
    // Restore the persistent state from local/session storage
    if (user.onBoardingRequired === true) {
      console.log(user.onBoardingRequired);
      // router.push({
      //   pathname: "/dashboard/welcome",
      //   query: { returnUrl: router.asPath },
      // });
      // setDisplayBanner(false);
    }
  }, []);

  const handleDismissBanner = () => {
    // Update the persistent state
    // globalThis.sessionStorage.setItem('dismiss-banner', 'true');
    setDisplayBanner(false);
  };

  return (
    <>
      <Head>
        <title>Dashboard: Overview | Material Kit Pro</title>
      </Head>
      <Box
        component="main"
        sx={{
          flexGrow: 1,
          py: 8,
        }}
      >
        <Container maxWidth="xl">
          <Box sx={{ mb: 4 }}>
            <Grid container justifyContent="space-between" spacing={3}>
              <Grid item>
                <Typography variant="h4">{`${t("Welcome")} ${
                  user.name
                },`}</Typography>
              </Grid>
              <Grid
                item
                sx={{
                  display: "flex",
                  alignItems: "center",
                  m: -1,
                }}
              >
                <Button
                  startIcon={<ReportsIcon fontSize="small" />}
                  sx={{ m: 1 }}
                  variant="outlined"
                >
                  Reports
                </Button>
                <TextField
                  defaultValue="week"
                  label="Period"
                  select
                  size="small"
                  sx={{ m: 1 }}
                >
                  <MenuItem value="week">Last week</MenuItem>
                  <MenuItem value="month">Last month</MenuItem>
                  <MenuItem value="year">Last year</MenuItem>
                </TextField>
              </Grid>
            </Grid>
          </Box>
          <Grid container spacing={4}>
            <Grid item md={6} xs={12}>
              <Card>
                <CardContent>
                  <Box
                    sx={{
                      alignItems: "center",
                      display: "flex",
                    }}
                  >
                    <BriefcaseIcon color="primary" fontSize="small" />
                    <Typography
                      color="primary.main"
                      sx={{ pl: 1 }}
                      variant="subtitle2"
                    >
                      Jobs
                    </Typography>
                  </Box>
                  <Typography variant="h6" sx={{ mt: 2 }}>
                    Find your dream job
                  </Typography>
                  <Typography color="textSecondary" variant="body2">
                    Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed
                    do eiusmod tempor incididunt ut labore et dolore magna
                    aliqua.
                  </Typography>
                </CardContent>
                <Divider />
                <CardActions>
                  <Button
                    endIcon={<ArrowRightIcon fontSize="small" />}
                    size="small"
                  >
                    Search Jobs
                  </Button>
                </CardActions>
              </Card>
            </Grid>
            <Grid item md={6} xs={12}>
              <Card>
                <CardContent>
                  <Box
                    sx={{
                      alignItems: "center",
                      display: "flex",
                    }}
                  >
                    <InformationCircleOutlinedIcon color="primary" />
                    <Typography
                      color="primary.main"
                      sx={{ pl: 1 }}
                      variant="subtitle2"
                    >
                      Help Center
                    </Typography>
                  </Box>
                  <Typography sx={{ mt: 2 }} variant="h6">
                    Need help figuring things out?
                  </Typography>
                  <Typography color="textSecondary" variant="body2">
                    Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed
                    do eiusmod tempor incididunt ut labore et dolore magna
                    aliqua.
                  </Typography>
